import React, { Component } from 'react';
import UserInfo from './UserInfo';
import WorkExperience from './WorkExperience';
import './Builder.css';

class Builder extends Component {
  changeUserInfoToEditMode = (element) => {
    this.props.changeUserInfoToEditMode(element);
  };
  handleInputChange = (element) => {
    this.props.handleInputChange(element);
  };
  handleUpdateBtn = (element) => {
    this.props.handleUpdateBtn(element);
  };
  render() {
    const { appMode , userInfoArray } = this.props;
    return (
      <main>
        <UserInfo
          appMode={appMode}
          userInfoArray={userInfoArray}
          handleInputChange={this.handleInputChange}
          handleUpdateBtn={this.handleUpdateBtn}

        />
        <WorkExperience appMode={appMode} />
      </main>
    );
  }
}

export default Builder;
